import { Link } from 'react-router-dom';
import classes from './NoDataFound.module.css';

const NoDataFound = () => {
  return (
    <div className={classes.noData}>
      <p>No  found!</p>
      <Link className='btn' to='/login'>
        Players List
      </Link>
    </div>
  );
};

export default NoDataFound;
